const orderQuestions = questions => {
    let orderedQuestions = questions.sort((a, b) => a.number - b.number);

    orderedQuestions.forEach(question => {
        question.answerChoices.forEach(answer => console.log(answer.letter))
        const sortedAnswerChoices = question.answerChoices.sort((a, b) => a.letter < b.letter);
        console.log(sortedAnswerChoices)
    })

    return orderedQuestions;
}

export default orderQuestions;
